import style  from "./Card.css";

export default function Card(props) {
   
   return (
       
      <div className="container">
         <button className={style.boton} onClick={props.onClose}>X</button>
         <h2>{props.name}</h2>
         <img  src={props.image} alt="rick" />
         <div className={style.text}>
         <h2>{props.species}</h2>
         <h2>{props.gender}</h2>
         </div>
      </div>
   );
}
